import React from 'react'
import Button from '@material-ui/core/Button'
import {FaRegFilePdf} from "react-icons/fa"
import './NavBar2.css'
import { createMuiTheme, ThemeProvider, WithStyles, makeStyles} from '@material-ui/core/styles';

function NavBar2 (props) {

    const theme = createMuiTheme({
        overrides: {
            MuiButton:{
                label:{

                    // fontWeight: "300", 
                    // fontFamily:"FuturaPT, Helvetica, Arial, sans-serif", 
                }
            }

        }});
    return (
        <ThemeProvider theme={theme}>
        <ul className="listNavBar" style={styles.ul}>
            <li style={styles.li}>  About Me   </li>
            <li style={styles.li}> Experience </li>
            <li style={styles.li}>  Hobbies </li>
            <li style={styles.li}>  <Button className={theme.root}> Résumé&nbsp;&nbsp; <FaRegFilePdf /></Button> </li>
        </ul>
        </ThemeProvider>
    )
}

const theme = makeStyles({
    root: {
        background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)',
        border: 0,
        borderRadius: 3,
        boxShadow: '0 3px 5px 2px rgba(255, 105, 135, .3)',
        color: 'white',
        height: 48,
        padding: '0 30px',
      },
})
const styles = 
    {
        ul: {
            width: "fit-content",
            float: "right",
        }, 
        button:{
            border: "0.5px solid rgb(100,255,218)",
            color: "rgb(100,255,218)", 

        },
        li:{
            display: "inline-block",
            color: "honeydew",
            margin: "1rem", 
            fontFamily:"FuturaPT, Helvetica, Arial, sans-serif",
            fontWeight: "300", 
        }
    }

export default NavBar2;
